import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PropertyDetailsComponent = () => {
  const [propertyDetails, setPropertyDetails] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:9856/api/property/fetch')
      .then(response => {
        setPropertyDetails(response.data);
      })
      .catch(error => {
        console.error('Error fetching property details:', error);
      });
  }, []);

  return (
    <div>
      <h2>Property Details</h2>
      <Table striped bordered hover> {/* Use Bootstrap Table component */}
      <thead>
        <tr>
          <th>ID</th>
          <th>Current Market Value</th>
          <th>Carpet Area</th>
          <th>Pincode</th>
          {/* Add more headers as needed */}
        </tr>
      </thead>
      <tbody>
        {propertyDetails.map(property => (
          <tr key={property.id}>
            <td>{property.id}</td>
            <td>{property.currentMarketValue}</td>
            <td>{property.carpetArea}</td>
            <td>{property.pincode}</td>
            {/* Add more cells as needed */}
          </tr>
        ))}
      </tbody>
    </Table>
    </div>
  );
};

export default PropertyDetailsComponent;
